import React from "react";
import moment from "moment";

const ReturnedMovies = ({ rentals }) => {
  return (
    <div>
      <h2>Returned Movies from Customers</h2>
      <ul>
        {rentals.map((rental) => {
          return (
            rental.dateReturned && (
              <li className="mb-2">
                {`${rental.customer.name} returned the movie ${rental.movie.title} on
              ${moment(rental.dateReturned).format("MMM Do YYYY")}.`}
              </li>
            )
          );
        })}
      </ul>
    </div>
  );
};

export default ReturnedMovies;
